    "2016-07-27T22:41:54.354652",nt"name": "contaminants-in-waterbirds-grackles-and-swallows-nesting-on-the-lower-colorado-river-2000-",nt"isopen":
    false,nt"url": null,nt"notes": "Levels and potential effects of organochlorine
    compounds and metals were assessed in 106 eggs representing nine avian species nesting
    at four lower Colorado River National Wildlife Refuges. Geometric mean DDE residues
    were highest in the eggs of white-faced ibis (Pegadis chihi) (2.34 ug/g wet weight)
    and double-crested cormorant (Phalacrocorax auritus) (0.75 ug/g wet weight). White-faced
    ibises fledged 4.0 ug/g) DDE residues detected in 48% of the eggs. Mean shell thickness
    of 23 ibis eggs was 0.264 mm, 15% thinner than shells of eggs collected before the
    widespread use of DDT (P 6.0 ug/g) concentrations of selenium. The frequency of
    occurrence of elevated levels of selenium was greatest in eggs of western (Aechmophorus
    occidentalis) (87%) and Clark's grebe (76%). Generally, eggs of fish-eating birds
    contained the highest concentrations of selenium, followed by eggs of omnivorous
    species. None of the eggs of the insectivorous cliff swallow contained selenium
    above the 6.0 ug/g toxic threshold. Selenium concentrations were higher in swallow
    nestlings than in eggs suggesting that selenium bioaccumulation occurred during
    the first 10-days of life.",nt"license_title": "License Not Specified",nt"extras":
